import * as React from "react";
import { BrowserRouter as Router, Route } from "react-router-dom";

import Nav from "./components/Nav";
import Login from "./routes/Login";

function App() {
  return (
    <Router>
      <div className="container">
        <Nav></Nav>
		<Login></Login>
      </div>
    </Router>
  );
}

export default App;
